import React from 'react';
import './App.css';
import Navbar from './components/layout/Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'

function App() {
  return (
    <Router>
      <React.Fragment>
      <Navbar />
        <div className="container">  
        <Switch>
          <Route exact path ="/">
          </Route>
        </Switch>
        </div>
      </React.Fragment>     
    </Router>

  );
}

export default App;
